import React, { Component } from 'react'

import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import 'primeicons/primeicons.css';


import { Sidebar } from 'primereact/sidebar';
import { Card, Row } from 'react-bootstrap';

import { InputText } from 'primereact/inputtext';
import "bootstrap-icons/font/bootstrap-icons.css";



const SideBar = () => {
        return (
            <div>

            <Sidebar visible={true} position="left" baseZIndex="2px" className="p-sidebar-icon" style={{width:'4em'}} showCloseIcon={false} icons={() => (
    <React.Fragment>
        <div className="vertical-icons">

    <a class="btn" class="btn btn-outline-dark" href="#" role="button">
    <i class="bi bi-house-fill"></i>
    </a>

    <a class="btn" class="btn btn-outline-dark" href="#" role="button">
    <i class="bi bi-folder"></i>
    </a>

    <a class="btn" class="btn btn-outline-dark" href="#" role="button">
    <i class="bi bi-files"></i>
    </a>
    <a class="btn" class="btn btn-outline-dark" href="/expenses" role="button">
    <i class="bi bi-currency-dollar"></i>
    </a>
    <a class="btn" class="btn btn-outline-dark" href="#" role="button">
    <i class="bi bi-calendar3"></i>
    </a>
    <a class="btn" class="btn btn-outline-dark" href="#" role="button">
    <i class="bi bi-bar-chart-line-fill"></i>
    </a>
    <a class="btn" class="btn btn-outline-dark" href="#" role="button">
    <i class="bi bi-list-ul"></i>
    </a>

        </div>

    </React.Fragment>
    )}>

            </Sidebar>
            </div>
        )
}

export default SideBar;
